  \"terrain-kittitas-washington\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\":
  \"The Kittitas AOI consists of two areas. These areas were to be collected to the
  'highest' accuracy requirement. Ground Control is collected throughout the AOI for
  use in the processing of LiDAR data to ensure data accurately represents the ground
  surface. QA/QC checkpoints, (FVA and CVA - see Ground Control process step for further
  information) are located throughout the area, and are used for independent quality
  checks of the processed LiDAR data. LiDAR acquisition products include Pre- and
  Post- flight reports which contain information on the flightlines, equipment parameters,
  and other pertinant acquisition details. The LiDAR Point Cloud product consists
  of tiles of LAS points which are partially classified such that the bare earth points
  can be calibrated to the ground surface and tested via the independent QC to ensure
  the ground surface is accurately represented. The LiDAR processing product consists
  of LAS points which are fully classified with the bare earth points tested via the
  independent QC to ensure the ground surface is accurately represented.\",\n\t\"license_title\":
